//schema.org/CreativeWork\"}],\"http://schema.org/rangeIncludes\":[{\"@id\":\"http://schema.org/Text\"},{\"@id\":\"http://schema.org/URL\"},{\"@id\":\"http://schema.org/Product\"}],\"rdfs:comment\":\"A material that something is made from, e.g. leather, wool, cotton, paper.\",\"rdfs:label\":\"material\"},{\"@id\":\"http://schema.org/GovernmentBuilding\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"A government building.\",\"rdfs:label\":\"GovernmentBuilding\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/CivicStructure\"}},{\"@id\":\"http://schema.org/EmergencyService\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"An emergency service, such as a fire station or ER.\",\"rdfs:label\":\"EmergencyService\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/LocalBusiness\"}},{\"@id\":\"http://schema.org/issuedBy\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":[{\"@id\":\"http://schema.org/Ticket\"},{\"@id\":\"http://schema.org/Permit\"}],\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/Organization\"},\"rdfs:comment\":\"The organization issuing the ticket or permit.\",\"rdfs:label\":\"issuedBy\"},{\"@id\":\"http://schema.org/email\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":[{\"@id\":\"http://schema.org/Person\"},{\"@id\":\"http://schema.org/ContactPoint\"},{\"@id\":\"http://schema.org/Organization\"}],\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/Text\"},\"rdfs:comment\":\"Email address.\",\"rdfs:label\":\"email\"},{\"@id\":\"http://schema.org/albumRelease\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":{\"@id\":\"http://schema.org/MusicAlbum\"},\"http://schema.org/inverseOf\":{\"@id\":\"http://schema.org/releaseOf\"},\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/MusicRelease\"},\"rdfs:comment\":\"A release of this album.\",\"rdfs:label\":\"albumRelease\"},{\"@id\":\"http://schema.org/FinancialService\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"Financial services business.\",\"rdfs:label\":\"FinancialService\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/LocalBusiness\"}},{\"@id\":\"http://schema.org/VideoObject\",\"@type\":\"rdfs:Class\",\"http://purl.org/dc/terms/source\":{\"@id\":\"http://www.w3.org/wiki/WebSchemas/SchemaDotOrgSources#source_rNews\"},\"rdfs:comment\":\"A video file.\",\"rdfs:label\":\"VideoObject\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/MediaObject\"}},{\"@id\":\"http://schema.org/potentialAction\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":{\"@id\":\"http://schema.org/Thing\"},\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/Action\"},\"rdfs:comment\":\"Indicates a potential Action, which describes an idealized action in which this thing would play an 'object' role.\",\"rdfs:label\":\"potentialAction\"},{\"@id\":\"http://schema.org/isFamilyFriendly\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":{\"@id\":\"http://schema.org/CreativeWork\"},\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/Boolean\"},\"rdfs:comment\":\"Indicates whether this content is family friendly.\",\"rdfs:label\":\"isFamilyFriendly\"},{\"@id\":\"http://schema.org/weight\",\"@type\":\"rdf:Property\",\"http://purl.org/dc/terms/source\":{\"@id\":\"http://www.w3.org/wiki/WebSchemas/SchemaDotOrgSources#source_GoodRelationsTerms\"},\"http://schema.org/domainIncludes\":[{\"@id\":\"http://schema.org/Person\"},{\"@id\":\"http://schema.org/Product\"}],\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/QuantitativeValue\"},\"rdfs:comment\":\"The weight of the product or person.\",\"rdfs:label\":\"weight\"},{\"@id\":\"http://schema.org/Menu\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"A structured representation of food or drink items available from a FoodEstablishment.\",\"rdfs:label\":\"Menu\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/CreativeWork\"}},{\"@id\":\"http://schema.org/Periodical\",\"@type\":\"rdfs:Class\",\"http://purl.org/dc/terms/source\":{\"@id\":\"http://www.w3.org/wiki/WebSchemas/SchemaDotOrgSources#source_bibex\"},\"http://www.w3.org/2002/07/owl#equivalentClass\":{\"@id\":\"http://purl.org/ontology/bibo/Periodical\"},\"rdfs:comment\":\"A publication in any medium issued in successive parts bearing numerical or chronological designations and intended, such as a magazine, scholarly journal, or newspaper to continue indefinitely.</p>\\n\\n<p>See also <a href=\\\"http://blog.schema.org/2014/09/schemaorg-support-for-bibliographic_2.html\\\">blog post</a>.\",\"rdfs:label\":\"Periodical\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/CreativeWorkSeries\"}},{\"@id\":\"http://schema.org/broadcastOfEvent\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":{\"@id\":\"http://schema.org/BroadcastEvent\"},\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/Event\"},\"rdfs:comment\":\"The event being broadcast such as a sporting event or awards ceremony.\",\"rdfs:label\":\"broadcastOfEvent\"},{\"@id\":\"http://schema.org/numberOfBeds\",\"@type\":\"rdf:Property\",\"http://purl.org/dc/terms/source\":{\"@id\":\"https://www.w3.org/wiki/WebSchemas/SchemaDotOrgSources#STI_Accommodation_Ontology\"},\"http://schema.org/domainIncludes\":{\"@id\":\"http://schema.org/BedDetails\"},\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/Number\"},\"rdfs:comment\":\"The quantity of the given bed type available in the HotelRoom, Suite, House, or Apartment.\",\"rdfs:label\":\"numberOfBeds\"},{\"@id\":\"http://schema.org/steps\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":[{\"@id\":\"http://schema.org/HowToSection\"},{\"@id\":\"http://schema.org/HowTo\"}],\"http://schema.org/rangeIncludes\":[{\"@id\":\"http://schema.org/ItemList\"},{\"@id\":\"http://schema.org/CreativeWork\"},{\"@id\":\"http://schema.org/Text\"}],\"rdfs:comment\":\"The steps in the form of a single item (text, document, video, etc.) or an ordered list with HowToStep and/or HowToSection items.\",\"rdfs:label\":\"steps\"},{\"@id\":\"http://schema.org/Series\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"A Series in schema.org is a group of related items, typically but not necessarily of the same kind.\",\"rdfs:label\":\"Series\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/CreativeWork\"}},{\"@id\":\"http://schema.org/buyer\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":{\"@id\":\"http://schema.org/SellAction\"},\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/Person\"},\"rdfs:comment\":\"A sub property of participant. The participant/person/organization that bought the object.\",\"rdfs:label\":\"buyer\",\"rdfs:subPropertyOf\":{\"@id\":\"http://schema.org/participant\"}},{\"@id\":\"http://schema.org/Electrician\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"An electrician.\",\"rdfs:label\":\"Electrician\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/HomeAndConstructionBusiness\"}},{\"@id\":\"http://schema.org/depth\",\"@type\":\"rdf:Property\",\"http://purl.org/dc/terms/source\":{\"@id\":\"http://www.w3.org/wiki/WebSchemas/SchemaDotOrgSources#source_GoodRelationsTerms\"},\"http://schema.org/domainIncludes\":[{\"@id\":\"http://schema.org/VisualArtwork\"},{\"@id\":\"http://schema.org/Product\"}],\"http://schema.org/rangeIncludes\":[{\"@id\":\"http://schema.org/QuantitativeValue\"},{\"@id\":\"http://schema.org/Distance\"}],\"rdfs:comment\":\"The depth of the item.\",\"rdfs:label\":\"depth\"},{\"@id\":\"http://schema.org/printSection\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":{\"@id\":\"http://schema.org/NewsArticle\"},\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/Text\"},\"rdfs:comment\":\"If this NewsArticle appears in print, this field indicates the print section in which the article appeared.\",\"rdfs:label\":\"printSection\"},{\"@id\":\"http://schema.org/WarrantyScope\",\"@type\":\"rdfs:Class\",\"http://purl.org/dc/terms/source\":{\"@id\":\"http://www.w3.org/wiki/WebSchemas/SchemaDotOrgSources#source_GoodRelationsClass\"},\"rdfs:comment\":\"<p>A range of of services that will be provided to a customer free of charge in case of a defect or malfunction of a product.</p>\\n\\n<p>Commonly used values:</p>\\n\\n<ul>\\n<li>http://purl.org/goodrelations/v1#Labor-BringIn</li>\\n<li>http://purl.org/goodrelations/v1#PartsAndLabor-BringIn</li>\\n<li>http://purl.org/goodrelations/v1#PartsAndLabor-PickUp</li>\\n</ul>\\n\",\"rdfs:label\":\"WarrantyScope\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/Enumeration\"}},{\"@id\":\"http://schema.org/httpMethod\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":{\"@id\":\"http://schema.org/EntryPoint\"},\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/Text\"},\"rdfs:comment\":\"An HTTP method that specifies the appropriate HTTP method for a request to an HTTP EntryPoint. Values are capitalized strings as used in HTTP.\",\"rdfs:label\":\"httpMethod\"},{\"@id\":\"http://schema.org/CollectionPage\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"Web page type: Collection page.\",\"rdfs:label\":\"CollectionPage\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/WebPage\"}},{\"@id\":\"http://schema.org/PhotographAction\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"The act of capturing still images of objects using a camera.\",\"rdfs:label\":\"PhotographAction\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/CreateAction\"}},{\"@id\":\"http://schema.org/vehicleInteriorType\",\"@type\":\"rdf:Property\",\"http://purl.org/dc/terms/source\":{\"@id\":\"http://www.w3.org/wiki/WebSchemas/SchemaDotOrgSources#Automotive_Ontology_Working_Group\"},\"http://schema.org/domainIncludes\":{\"@id\":\"http://schema.org/Vehicle\"},\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/Text\"},\"rdfs:comment\":\"The type or material of the interior of the vehicle (e.g. synthetic fabric, leather, wood, etc.). While most interior types are characterized by the material used, an interior type can also be based on vehicle usage or target audience.\",\"rdfs:label\":\"vehicleInteriorType\"},{\"@id\":\"http://schema.org/performTime\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":[{\"@id\":\"http://schema.org/HowTo\"},{\"@id\":\"http://schema.org/HowToDirection\"}],\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/Duration\"},\"rdfs:comment\":\"The length of time it takes to perform instructions or a direction (not including time to prepare the supplies), in <a href=\\\"http://en.wikipedia.org/wiki/ISO_8601\\\">ISO 8601 duration format</a>.\",\"rdfs:label\":\"performTime\"},{\"@id\":\"http://schema.org/HealthAndBeautyBusiness\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"Health and beauty.\",\"rdfs:label\":\"HealthAndBeautyBusiness\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/LocalBusiness\"}},{\"@id\":\"http://schema.org/LegislativeBuilding\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"A legislative building&#x2014;for example, the state capitol.\",\"rdfs:label\":\"LegislativeBuilding\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/GovernmentBuilding\"}},{\"@id\":\"http://schema.org/exampleOfWork\",\"@type\":\"rdf:Property\",\"http://purl.org/dc/terms/source\":{\"@id\":\"http://www.w3.org/wiki/WebSchemas/SchemaDotOrgSources#source_bibex\"},\"http://schema.org/domainIncludes\":{\"@id\":\"http://schema.org/CreativeWork\"},\"http://schema.org/inverseOf\":{\"@id\":\"http://schema.org/workExample\"},\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/CreativeWork\"},\"rdfs:comment\":\"A creative work that this work is an example/instance/realization/derivation of.\",\"rdfs:label\":\"exampleOfWork\"},{\"@id\":\"http://schema.org/UserCheckins\",\"@type\":\"rdfs:Class\",\"http://schema.org/supersededBy\":{\"@id\":\"http://schema.org/InteractionCounter\"},\"rdfs:comment\":\"UserInteraction and its subtypes is an old way of talking about users interacting with pages. It is generally better to use <a class=\\\"localLink\\\" href=\\\"http://schema.org/Action\\\">Action</a>-based vocabulary, alongside types such as <a class=\\\"localLink\\\" href=\\\"http://schema.org/Comment\\\">Comment</a>.\",\"rdfs:label\":\"UserCheckins\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/UserInteraction\"}},{\"@id\":\"http://schema.org/opens\",\"@type\":\"rdf:Property\",\"http://purl.org/dc/terms/source\":{\"@id\":\"http://www.w3.org/wiki/WebSchemas/SchemaDotOrgSources#source_GoodRelationsTerms\"},\"http://schema.org/domainIncludes\":{\"@id\":\"http://schema.org/OpeningHoursSpecification\"},\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/Time\"},\"rdfs:comment\":\"The opening hour of the place or service on the given day(s) of the week.\",\"rdfs:label\":\"opens\"},{\"@id\":\"http://schema.org/version\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":{\"@id\":\"http://schema.org/CreativeWork\"},\"http://schema.org/rangeIncludes\":[{\"@id\":\"http://schema.org/Text\"},{\"@id\":\"http://schema.org/Number\"}],\"rdfs:comment\":\"The version of the CreativeWork embodied by a specified resource.\",\"rdfs:label\":\"version\"},{\"@id\":\"http://schema.org/paymentMethod\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":[{\"@id\":\"http://schema.org/Order\"},{\"@id\":\"http://schema.org/Invoice\"}],\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/PaymentMethod\"},\"rdfs:comment\":\"The name of the credit card or other method of payment for the order.\",\"rdfs:label\":\"paymentMethod\"},{\"@id\":\"http://schema.org/dateModified\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":[{\"@id\":\"http://schema.org/CreativeWork\"},{\"@id\":\"http://schema.org/DataFeedItem\"}],\"http://schema.org/rangeIncludes\":[{\"@id\":\"http://schema.org/DateTime\"},{\"@id\":\"http://schema.org/Date\"}],\"rdfs:comment\":\"The date on which the CreativeWork was most recently modified or when the item's entry was modified within a DataFeed.\",\"rdfs:label\":\"dateModified\"},{\"@id\":\"http://schema.org/VideoGameSeries\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"A video game series.\",\"rdfs:label\":\"VideoGameSeries\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/CreativeWorkSeries\"}},{\"@id\":\"http://schema.org/BroadcastService\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"A delivery service through which content is provided via broadcast over the air or online.\",\"rdfs:label\":\"BroadcastService\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/Service\"}},{\"@id\":\"http://schema.org/associatedArticle\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":{\"@id\":\"http://schema.org/MediaObject\"},\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/NewsArticle\"},\"rdfs:comment\":\"A NewsArticle associated with the Media Object.\",\"rdfs:label\":\"associatedArticle\"},{\"@id\":\"http://schema.org/mainEntity\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":{\"@id\":\"http://schema.org/CreativeWork\"},\"http://schema.org/inverseOf\":{\"@id\":\"http://schema.org/mainEntityOfPage\"},\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/Thing\"},\"rdfs:comment\":\"Indicates the primary entity described in some page or other CreativeWork.\",\"rdfs:label\":\"mainEntity\",\"rdfs:subPropertyOf\":{\"@id\":\"http://schema.org/about\"}},{\"@id\":\"http://schema.org/RegisterAction\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"<p>The act of registering to be a user of a service, product or web page.</p>\\n\\n<p>Related actions:</p>\\n\\n<ul>\\n<li><a class=\\\"localLink\\\" href=\\\"http://schema.org/JoinAction\\\">JoinAction</a>: Unlike JoinAction, RegisterAction implies you are registering to be a user of a service, <em>not</em> a group/team of people.</li>\\n<li>[FollowAction]]: Unlike FollowAction, RegisterAction doesn't imply that the agent is expecting to poll for updates from the object.</li>\\n<li><a class=\\\"localLink\\\" href=\\\"http://schema.org/SubscribeAction\\\">SubscribeAction</a>: Unlike SubscribeAction, RegisterAction doesn't imply that the agent is expecting updates from the object.</li>\\n</ul>\\n\",\"rdfs:label\":\"RegisterAction\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/InteractAction\"}},{\"@id\":\"http://schema.org/productionCompany\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":[{\"@id\":\"http://schema.org/Episode\"},{\"@id\":\"http://schema.org/MovieSeries\"},{\"@id\":\"http://schema.org/TVSeries\"},{\"@id\":\"http://schema.org/MediaObject\"},{\"@id\":\"http://schema.org/VideoGameSeries\"},{\"@id\":\"http://schema.org/Movie\"},{\"@id\":\"http://schema.org/RadioSeries\"},{\"@id\":\"http://schema.org/CreativeWorkSeason\"}],\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/Organization\"},\"rdfs:comment\":\"The production company or studio responsible for the item e.g. series, video game, episode etc.\",\"rdfs:label\":\"productionCompany\"},{\"@id\":\"http://schema.org/WearAction\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"The act of dressing oneself in clothing.\",\"rdfs:label\":\"WearAction\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/UseAction\"}},{\"@id\":\"http://schema.org/TravelAgency\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"A travel agency.\",\"rdfs:label\":\"TravelAgency\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/LocalBusiness\"}},{\"@id\":\"http://schema.org/PerformingGroup\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"A performance group, such as a band, an orchestra, or a circus.\",\"rdfs:label\":\"PerformingGroup\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/Organization\"}},{\"@id\":\"http://schema.org/Hostel\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"A hostel - cheap accommodation, often in shared dormitories.\\n<br /><br />\\nSee also the <a href=\\\"/docs/hotels.html\\\">dedicated document on the use of schema.org for marking up hotels and other forms of accommodations</a>.\",\"rdfs:label\":\"Hostel\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/LodgingBusiness\"}},{\"@id\":\"http://schema.org/deliveryMethod\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":[{\"@id\":\"http://schema.org/OrderAction\"},{\"@id\":\"http://schema.org/SendAction\"},{\"@id\":\"http://schema.org/ReceiveAction\"},{\"@id\":\"http://schema.org/TrackAction\"}],\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/DeliveryMethod\"},\"rdfs:comment\":\"A sub property of instrument. The method of delivery.\",\"rdfs:label\":\"deliveryMethod\",\"rdfs:subPropertyOf\":{\"@id\":\"http://schema.org/instrument\"}},{\"@id\":\"http://schema.org/endorsee\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":{\"@id\":\"http://schema.org/EndorseAction\"},\"http://schema.org/rangeIncludes\":[{\"@id\":\"http://schema.org/Person\"},{\"@id\":\"http://schema.org/Organization\"}],\"rdfs:comment\":\"A sub property of participant. The person/organization being supported.\",\"rdfs:label\":\"endorsee\",\"rdfs:subPropertyOf\":{\"@id\":\"http://schema.org/participant\"}},{\"@id\":\"http://schema.org/alignmentType\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":{\"@id\":\"http://schema.org/AlignmentObject\"},\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/Text\"},\"rdfs:comment\":\"A category of alignment between the learning resource and the framework node. Recommended values include: 'assesses', 'teaches', 'requires', 'textComplexity', 'readingLevel', 'educationalSubject', and 'educationalLevel'.\",\"rdfs:label\":\"alignmentType\"},{\"@id\":\"http://schema.org/assemblyVersion\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":{\"@id\":\"http://schema.org/APIReference\"},\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/Text\"},\"rdfs:comment\":\"Associated product/technology version. e.g., .NET Framework 4.5.\",\"rdfs:label\":\"assemblyVersion\"},{\"@id\":\"http://schema.org/branchOf\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":{\"@id\":\"http://schema.org/LocalBusiness\"},\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/Organization\"},\"http://schema.org/supersededBy\":{\"@id\":\"http://schema.org/parentOrganization\"},\"rdfs:comment\":\"The larger organization that this local business is a branch of, if any. Not to be confused with (anatomical)<a class=\\\"localLink\\\" href=\\\"http://schema.org/branch\\\">branch</a>.\",\"rdfs:label\":\"branchOf\"},{\"@id\":\"http://schema.org/BankOrCreditUnion\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"Bank or credit union.\",\"rdfs:label\":\"BankOrCreditUnion\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/FinancialService\"}},{\"@id\":\"http://schema.org/Quantity\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"Quantities such as distance, time, mass, weight, etc. Particular instances of say Mass are entities like '3 Kg' or '4 milligrams'.\",\"rdfs:label\":\"Quantity\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/Intangible\"}},{\"@id\":\"http://schema.org/AllWheelDriveConfiguration\",\"@type\":\"http://schema.org/DriveWheelConfigurationValue\",\"http://purl.org/dc/terms/source\":{\"@id\":\"http://www.w3.org/wiki/WebSchemas/SchemaDotOrgSources#Automotive_Ontology_Working_Group\"},\"rdfs:comment\":\"All-wheel Drive is a transmission layout where the engine drives all four wheels.\",\"rdfs:label\":\"AllWheelDriveConfiguration\"},{\"@id\":\"http://schema.org/geo\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":{\"@id\":\"http://schema.org/Place\"},\"http://schema.org/rangeIncludes\":[{\"@id\":\"http://schema.org/GeoCoordinates\"},{\"@id\":\"http://schema.org/GeoShape\"}],\"rdfs:comment\":\"The geo coordinates of the place.\",\"rdfs:label\":\"geo\"},{\"@id\":\"http://schema.org/VideoGallery\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"Web page type: Video gallery page.\",\"rdfs:label\":\"VideoGallery\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/CollectionPage\"}},{\"@id\":\"http://schema.org/EducationalAudience\",\"@type\":\"rdfs:Class\",\"http://purl.org/dc/terms/source\":{\"@id\":\"http://www.w3.org/wiki/WebSchemas/SchemaDotOrgSources#source_LRMIClass\"},\"rdfs:comment\":\"An EducationalAudience.\",\"rdfs:label\":\"EducationalAudience\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/Audience\"}},{\"@id\":\"http://schema.org/department\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":{\"@id\":\"http://schema.org/Organization\"},\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/Organization\"},\"rdfs:comment\":\"A relationship between an organization and a department of that organization, also described as an organization (allowing different urls, logos, opening hours). For example: a store with a pharmacy, or a bakery with a cafe.\",\"rdfs:label\":\"department\"},{\"@id\":\"http://schema.org/targetUrl\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":{\"@id\":\"http://schema.org/AlignmentObject\"},\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/URL\"},\"rdfs:comment\":\"The URL of a node in an established educational framework.\",\"rdfs:label\":\"targetUrl\"},{\"@id\":\"http://schema.org/CityHall\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"A city hall.\",\"rdfs:label\":\"CityHall\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/GovernmentBuilding\"}},{\"@id\":\"http://schema.org/ReservationCancelled\",\"@type\":\"http://schema.org/ReservationStatusType\",\"rdfs:comment\":\"The status for a previously confirmed reservation that is now cancelled.\",\"rdfs:label\":\"ReservationCancelled\"},{\"@id\":\"http://schema.org/carbohydrateContent\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":{\"@id\":\"http://schema.org/NutritionInformation\"},\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/Mass\"},\"rdfs:comment\":\"The number of grams of carbohydrates.\",\"rdfs:label\":\"carbohydrateContent\"},{\"@id\":\"http://schema.org/ComedyEvent\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"Event type: Comedy event.\",\"rdfs:label\":\"ComedyEvent\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/Event\"}},{\"@id\":\"http://schema.org/isSimilarTo\",\"@type\":\"rdf:Property\",\"http://purl.org/dc/terms/source\":{\"@id\":\"http://www.w3.org/wiki/WebSchemas/SchemaDotOrgSources#source_GoodRelationsTerms\"},\"http://schema.org/domainIncludes\":[{\"@id\":\"http://schema.org/Service\"},{\"@id\":\"http://schema.org/Product\"}],\"http://schema.org/rangeIncludes\":[{\"@id\":\"http://schema.org/Product\"},{\"@id\":\"http://schema.org/Service\"}],\"rdfs:comment\":\"A pointer to another, functionally similar product (or multiple products).\",\"rdfs:label\":\"isSimilarTo\"},{\"@id\":\"http://schema.org/DonateAction\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"The act of providing goods, services, or money without compensation, often for philanthropic reasons.\",\"rdfs:label\":\"DonateAction\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/TradeAction\"}},{\"@id\":\"http://schema.org/closes\",\"@type\":\"rdf:Property\",\"http://purl.org/dc/terms/source\":{\"@id\":\"http://www.w3.org/wiki/WebSchemas/SchemaDotOrgSources#source_GoodRelationsTerms\"},\"http://schema.org/domainIncludes\":{\"@id\":\"http://schema.org/OpeningHoursSpecification\"},\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/Time\"},\"rdfs:comment\":\"The closing hour of the place or service on the given day(s) of the week.\",\"rdfs:label\":\"closes\"},{\"@id\":\"http://schema.org/Brand\",\"@type\":\"rdfs:Class\",\"http://purl.org/dc/terms/source\":{\"@id\":\"http://www.w3.org/wiki/WebSchemas/SchemaDotOrgSources#source_GoodRelationsClass\"},\"rdfs:comment\":\"A brand is a name used by an organization or business person for labeling a product, product group, or similar.\",\"rdfs:label\":\"Brand\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/Intangible\"}},{\"@id\":\"http://schema.org/MovingCompany\",\"@type\":\"rdfs:Class\",\"r