//schema.org/Place\"}],\"rdfs:comment\":\"The ISO 3166-1 (ISO 3166-1 alpha-2) or ISO 3166-2 code, the place, or the GeoShape for the geo-political region(s) for which the offer or delivery charge specification is valid.</p>\\n\\n<p>See also <a class=\\\"localLink\\\" href=\\\"http://schema.org/ineligibleRegion\\\">ineligibleRegion</a>.\",\"rdfs:label\":\"eligibleRegion\",\"rdfs:subPropertyOf\":{\"@id\":\"http://schema.org/areaServed\"}},{\"@id\":\"http://schema.org/ItemListOrderAscending\",\"@type\":\"http://schema.org/ItemListOrderType\",\"rdfs:comment\":\"An ItemList ordered with lower values listed first.\",\"rdfs:label\":\"ItemListOrderAscending\"},{\"@id\":\"http://schema.org/ImageGallery\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"Web page type: Image gallery page.\",\"rdfs:label\":\"ImageGallery\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/CollectionPage\"}},{\"@id\":\"http://schema.org/downvoteCount\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":[{\"@id\":\"http://schema.org/Question\"},{\"@id\":\"http://schema.org/Comment\"}],\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/Integer\"},\"rdfs:comment\":\"The number of downvotes this question, answer or comment has received from the community.\",\"rdfs:label\":\"downvoteCount\"},{\"@id\":\"http://schema.org/valueRequired\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":{\"@id\":\"http://schema.org/PropertyValueSpecification\"},\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/Boolean\"},\"rdfs:comment\":\"Whether the property must be filled in to complete the action.  Default is false.\",\"rdfs:label\":\"valueRequired\"},{\"@id\":\"http://schema.org/candidate\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":{\"@id\":\"http://schema.org/VoteAction\"},\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/Person\"},\"rdfs:comment\":\"A sub property of object. The candidate subject of this action.\",\"rdfs:label\":\"candidate\",\"rdfs:subPropertyOf\":{\"@id\":\"http://schema.org/object\"}},{\"@id\":\"http://schema.org/Offer\",\"@type\":\"rdfs:Class\",\"http://purl.org/dc/terms/source\":{\"@id\":\"http://www.w3.org/wiki/WebSchemas/SchemaDotOrgSources#source_GoodRelationsTerms\"},\"rdfs:comment\":\"An offer to transfer some rights to an item or to provide a service  for example, an offer to sell tickets to an event, to rent the DVD of a movie, to stream a TV show over the internet, to repair a motorcycle, or to loan a book.</p>\\n\\n<p>For <a href=\\\"http://www.gs1.org/barcodes/technical/idkeys/gtin\\\">GTIN</a>-related fields, see <a href=\\\"http://www.gs1.org/barcodes/support/check_digit_calculator\\\">Check Digit calculator</a> and <a href=\\\"http://www.gs1us.org/resources/standards/gtin-validation-guide\\\">validation guide</a> from <a href=\\\"http://www.gs1.org/\\\">GS1</a>.\",\"rdfs:label\":\"Offer\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/Intangible\"}},{\"@id\":\"http://schema.org/DataDownload\",\"@type\":\"rdfs:Class\",\"http://purl.org/dc/terms/source\":{\"@id\":\"http://www.w3.org/wiki/WebSchemas/SchemaDotOrgSources#source_DatasetClass\"},\"http://www.w3.org/2002/07/owl#equivalentClass\":{\"@id\":\"http://www.w3.org/ns/dcat#Distribution\"},\"rdfs:comment\":\"A dataset in downloadable form.\",\"rdfs:label\":\"DataDownload\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/MediaObject\"}},{\"@id\":\"http://schema.org/Product\",\"@type\":\"rdfs:Class\",\"http://purl.org/dc/terms/source\":{\"@id\":\"http://www.w3.org/wiki/WebSchemas/SchemaDotOrgSources#source_GoodRelationsTerms\"},\"rdfs:comment\":\"Any offered product or service. For example: a pair of shoes; a concert ticket; the rental of a car; a haircut; or an episode of a TV show streamed online.\",\"rdfs:label\":\"Product\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/Thing\"}},{\"@id\":\"http://schema.org/accessCode\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":{\"@id\":\"http://schema.org/DeliveryEvent\"},\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/Text\"},\"rdfs:comment\":\"Password, PIN, or access code needed for delivery (e.g. from a locker).\",\"rdfs:label\":\"accessCode\"},{\"@id\":\"http://schema.org/CampingPitch\",\"@type\":\"rdfs:Class\",\"http://purl.org/dc/terms/source\":{\"@id\":\"https://www.w3.org/wiki/WebSchemas/SchemaDotOrgSources#STI_Accommodation_Ontology\"},\"rdfs:comment\":\"A camping pitch is an individual place for overnight stay in the outdoors, typically being part of a larger camping site.\\n<br /><br />\\nSee also the <a href=\\\"/docs/hotels.html\\\">dedicated document on the use of schema.org for marking up hotels and other forms of accommodations</a>.\",\"rdfs:label\":\"CampingPitch\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/Accommodation\"}},{\"@id\":\"http://schema.org/CivicStructure\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"A public structure, such as a town hall or concert hall.\",\"rdfs:label\":\"CivicStructure\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/Place\"}},{\"@id\":\"http://schema.org/homeTeam\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":{\"@id\":\"http://schema.org/SportsEvent\"},\"http://schema.org/rangeIncludes\":[{\"@id\":\"http://schema.org/SportsTeam\"},{\"@id\":\"http://schema.org/Person\"}],\"rdfs:comment\":\"The home team in a sports event.\",\"rdfs:label\":\"homeTeam\",\"rdfs:subPropertyOf\":{\"@id\":\"http://schema.org/competitor\"}},{\"@id\":\"http://schema.org/GeoCoordinates\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"The geographic coordinates of a place or event.\",\"rdfs:label\":\"GeoCoordinates\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/StructuredValue\"}},{\"@id\":\"http://schema.org/performer\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":{\"@id\":\"http://schema.org/Event\"},\"http://schema.org/rangeIncludes\":[{\"@id\":\"http://schema.org/Person\"},{\"@id\":\"http://schema.org/Organization\"}],\"rdfs:comment\":\"A performer at the event&#x2014;for example, a presenter, musician, musical group or actor.\",\"rdfs:label\":\"performer\"},{\"@id\":\"http://schema.org/MiddleSchool\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"A middle school (typically for children aged around 11-14, although this varies somewhat).\",\"rdfs:label\":\"MiddleSchool\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/EducationalOrganization\"}},{\"@id\":\"http://schema.org/AutomotiveBusiness\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"Car repair, sales, or parts.\",\"rdfs:label\":\"AutomotiveBusiness\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/LocalBusiness\"}},{\"@id\":\"http://schema.org/permittedUsage\",\"@type\":\"rdf:Property\",\"http://purl.org/dc/terms/source\":{\"@id\":\"https://www.w3.org/wiki/WebSchemas/SchemaDotOrgSources#STI_Accommodation_Ontology\"},\"http://schema.org/domainIncludes\":{\"@id\":\"http://schema.org/Accommodation\"},\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/Text\"},\"rdfs:comment\":\"Indications regarding the permitted usage of the accommodation.\",\"rdfs:label\":\"permittedUsage\"},{\"@id\":\"http://schema.org/item\",\"@type\":\"rdf:Property\",\"http://schema.org/domainIncludes\":[{\"@id\":\"http://schema.org/DataFeedItem\"},{\"@id\":\"http://schema.org/ListItem\"}],\"http://schema.org/rangeIncludes\":{\"@id\":\"http://schema.org/Thing\"},\"rdfs:comment\":\"An entity represented by an entry in a list or data feed (e.g. an 'artist' in a list of 'artists').\",\"rdfs:label\":\"item\"},{\"@id\":\"http://schema.org/LiteraryEvent\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"Event type: Literary event.\",\"rdfs:label\":\"LiteraryEvent\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/Event\"}},{\"@id\":\"http://schema.org/Pond\",\"@type\":\"rdfs:Class\",\"rdfs:comment\":\"A pond.\",\"rdfs:label\":\"Pond\",\"rdfs:subClassOf\":{\"@id\":\"http://schema.org/BodyOfWater\"}},{\"@id\":\"http://schema.org/discountCode\",\"@t